            int ret = get_metadata(s, metadata_tag, FFMIN(tag_size, size - 4));

            if (ret < 0) {

                av_log(s, AV_LOG_ERROR, "cannot allocate metadata tag %s!\n", metadata_tag);

                return ret;

            }

        }



        avio_skip(pb, size - (avio_tell(pb) - orig_pos) + (size & 1));

    }



    return 0;

